const initialState = {
  cartData: [],
};

function cartItem(state = initialState, action) {
  switch (action.type) {
    case "Add_To_Cart":
      return {
        ...state,
        cartData: action.payload,
      };

    default:
      return state;
  }
}

export default cartItem;
